	function UpdateRanks()
	{

		var form = document.forms[0];
		var ServiceID = form.ServiceID[form.ServiceID.selectedIndex].value;
		var RanksArray; 
		var RankID = form.RankID[form.RankID.selectedIndex].value;
		var Service;
		
		switch (ServiceID)
		{
			case '1':
				Service = 'ANG';
				break;
			case '2':
				Service = 'ARNG';
				break;
			case '3':
				Service = 'Contractor';
				break;
			case '4':
				Service = 'DACivilian';
				break;
			case '5':
				Service = 'USA';
				break;
			case '6':
				Service = 'USAF';
				break;
			case '7':
				Service = 'USCG';
				break;
			case '8':
				Service = 'USAR';
				break;
			case '9':
				Service = 'USAFR';
				break;
			case '10':
				Service = 'USMC';
				break;
			case '11':
				Service = 'USMCR';
				break;
			case '12':
				Service = 'USN';
				break;
			case '13':
				Service = 'USNR';
				break;
			case '14':
				Service = 'UK';
				break;
			case '15':
				Service = 'Other';
				break;
			case '16':
				Service = 'IF';
				break;
		}
		if (Service != '')
		{
			RankArray = objComponent[Service].arrRank;
			form.RankID.length = 0;
			
			for (var i = 1; i < RankArray.length; i++)
			{
				if (RankID == RankArray[i].code)
				{
					form.RankID.options[i] = new Option(RankArray[i].description, RankArray[i].code, '', selected);
				}
				else
				{
					form.RankID.options[i] = new Option(RankArray[i].description, RankArray[i].code);
				}
			}
		}
		else
		{
			form.RankID.length = 0;
			form.RankID.options[0] = new Option('','');
		}
	}
	</script>

<script language="javascript" type="text/javascript">

	function checkForm()
	{
		if(!checkRequired(document.frmEventRegister.FirstName))
		{
			alert('The first name field is required!');
			document.frmEventRegister.FirstName.focus()
			return false;
		}
		else if(!checkRequired(document.frmEventRegister.LastName))
		{
			alert('The last name field is required!');
			document.frmEventRegister.LastName.focus()
			return false;
		}
		else if(document.frmEventRegister.ServiceID.value == -1)
		{
			alert('The service field is required!');
			document.frmEventRegister.ServiceID.focus()
			return false;
		}
		else if((document.frmEventRegister.RankID.value == -1) || (document.frmEventRegister.RankID.value == ''))
		{
			alert('The rank field is required!');
			document.frmEventRegister.RankID.focus()
			return false;
		}
		else if(!checkRequired(document.frmEventRegister.Address1))
		{
			alert('The address 1 field is required!');
			document.frmEventRegister.Address1.focus()
			return false;
		}
		else if(!checkRequired(document.frmEventRegister.City))
		{
			alert('The city field is required!');
			document.frmEventRegister.City.focus()
			return false;
		}
		else if(document.frmEventRegister.StateID.value == -1)
		{
			alert('The state field is required!');
			document.frmEventRegister.StateID.focus()
			return false;
		}
		else if(!checkRequired(document.frmEventRegister.Zip))
		{
			alert('The zip code field is required!');
			document.frmEventRegister.Zip.focus()
			return false;
		}
		else if(document.frmEventRegister.EmailAddress.value != document.frmEventRegister.ConfirmEmailAddress.value)
		{
			alert('Your email and confirmation email addresses do not match!');
			document.frmEventRegister.EmailAddress.focus()
			return false;
		}
		else
		{
			document.frmEventRegister.submit();
		}
	}

</script>
